  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0138016 contains raw underway
  meteorological, navigational and physical data logged by the Scientific Computer
  System (SCS) aboard NOAA Ship Ferdinand R. Hassler in the North Atlantic Ocean from
  2015-07-27 to 2015-09-21. Office of Marine and Aviation Operations (OMAO) personnel
  aboard the ship submitted these data and associated metadata to NCEI. In addition,
  NCEI Accession 0138016 contains supplementary cruise-level metadata, which OMAO
  personnel logged in the Ship Daily Activity Log (SDAL). OMAO and NCEI personnel
  developed the automated process to archive these data under the auspices of the
  NOAA Rolling Deck to Repository (NOAA R2R) program.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
